import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { HomeRoutingModule } from './home-routing.module';


@NgModule({
  declarations: [home],
  imports: [
    CommonModule,
    HomeRoutingModule
  ]
})
export class HomeModule { }
